const Tabs = (props) => {
    return (
        <>
            {
                props.button.map((cur) => {
                    return <>
                        <button className='tab-button text-[16px] font-[400] leading-[1.5em] text-[#212529] mr-[30px]'>Our History</button>
                        <button className='tab-button text-[16px] font-[400] leading-[1.5em] text-[#212529] mr-[30px]'>Our Mission</button>
                        <button className='tab-button text-[16px] font-[400] leading-[1.5em] text-[#212529] mr-[30px]'>Our Values</button>
                    </>
                })
            }
        </>
    )
}

export default Tabs
